sys_variable_value.value:
(function execute(inputs, outputs) {

  var mandatoryInputs = {};
  mandatoryInputs.subscriptionId = inputs.subscriptionId;
  mandatoryInputs.resourceGroupName = inputs.resourceGroupName;
  mandatoryInputs.vmName = inputs.vmName;
  mandatoryInputs.lun = inputs.lun;
  new AzureComputeUtils().checkIfEmpty(mandatoryInputs);
  var util = new JSONBuilder();
  var storageProfile={};
  var dataDisk ={};
  var dataDisks =[];
  util.addObjectElement(dataDisk,'lun',inputs.lun);
  util.addObjectElement(dataDisk,'createOption',inputs.createOption);
  util.addObjectElement(dataDisk,'caching',inputs.caching);
  util.addObjectElement(dataDisk,'toBeDetached',inputs.toBeDetached);
  var managedDisk={};
  util.addObjectElement(managedDisk,'storageAccountType',inputs.storageAccountType);
  if(inputs.sourceID)
  util.addObjectElement(managedDisk,'id',inputs.sourceID);
  util.addObjectElement(dataDisk,'managedDisk',managedDisk);
  util.addArrayElement(dataDisks,dataDisk);
  util.addObjectElement(storageProfile,'dataDisks',dataDisks);
  var payload ={};
  var properties={};
  properties.storageProfile = storageProfile;
  payload.properties = properties;
  outputs.payload = JSON.stringify(payload);

})(inputs, outputs);

